import torch.nn as nn
from torch.optim.lr_scheduler import ExponentialLR
from torch_snippets.torch_loader import Report
from torch.optim.lr_scheduler import ExponentialLR

device = torch.device('cuda:0' if torch.cuda.is_available() else 'cpu')

loss_function = nn.CrossEntropyLoss()
def criterion(predictions, targets):
    loss = loss_function(predictions, targets)
    acc = (torch.max(predictions, dim=1)[1] == targets).float().mean()
    return loss, acc

num_epoch = 5
lr_decay_gamma = 0.9
log = Report(num_epoch)

def train_batch(model, data, optimizer, criterion):
    model.train()
    inputs, labels = data[0].to(device), data[1].to(device)
    optimizer.zero_grad()
    outputs = model(inputs)
    loss, acc = criterion(outputs, labels)
    loss.backward()
    optimizer.step()
    return loss, acc

@torch.no_grad()
def test_batch(model, data, criterion):
    model.eval()
    inputs, labels = data[0].to(device), data[1].to(device)
    outputs = model(inputs)
    loss, acc = criterion(outputs, labels)
    return loss, acc


# # MLP Baseline Model

# &emsp;Building the MLP Baseline model. Here is the simple model structure.
# ![mlp_structure.png](data:image/png;base64,)

# In[20]:


import torch.nn.functional as F

class MLP(nn.Module):
    # Define Multilayer Perceptron
    def __init__(self):
        super().__init__()
        self.conv1 = nn.Conv2d(3, 6, 5)
        self.pool = nn.MaxPool2d(2, 2)
        self.conv2 = nn.Conv2d(6, 16, 5)
        self.fc1 = nn.Linear(2704, 768)
        self.fc2 = nn.Linear(768, 84)
        self.fc3 = nn.Linear(84, 34)
        
    def forward(self, x):
        x = self.pool(F.relu(self.conv1(x)))
        x = self.pool(F.relu(self.conv2(x)))
        x = torch.flatten(x, 1)
        x = F.relu(self.fc1(x))
        x = F.relu(self.fc2(x))
        x = self.fc3(x)
        return x 
    
model = MLP()
optimizer = torch.optim.Adam(model.parameters(), lr=1e-3)
scheduler = ExponentialLR(optimizer, gamma=lr_decay_gamma, verbose=True)

for epoch in range(num_epoch):
    N = len(train_data_loader)
    for i, data in enumerate(train_data_loader, 0):
        loss, acc = train_batch(model, data, optimizer, criterion)
        if i % 5 == 0:
            log.record(pos=epoch + (i + 1) / N, mlp_train_loss=loss, mlp_train_acc=acc, end='\r')
    print()

    N = len(test_data_loader)
    for i, data in enumerate(test_data_loader, 0):
        loss, acc = test_batch(model, data, criterion)
        if i % 5 == 0:
            log.record(pos=epoch + (i + 1) / N, mlp_test_loss=loss, mlp_test_acc=acc, end='\r')
    print()
    scheduler.step()

